def min_coins(coins, amount, memo={}):

    if amount == 0:

        return 0

    if amount < 0:

        return float('inf')

    

    if amount in memo:

        return memo[amount]

    

    min_count = float('inf')

    

    for coin in coins:

        count = min_coins(coins, amount - coin, memo)

        if count != float('inf'):

            min_count = min(min_count, count + 1)

    

    memo[amount] = min_count

    return min_count
